import React, { Component } from 'react'
import PDF, { Text, AddPage, Line, Table, Html } from 'jspdf-react'

export class HeaderInfo extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <Text x={50} y={25} size={40}>NDC Rapportage</Text>

        )
    }
}

export default HeaderInfo
